class Opponent {
  constructor(fisrtName, lastName, tournament, club, age, strongHand, country, gameVideo) {
    this.fisrtName = fisrtName
    this.lastName = lastName
    this.tournament = tournament
    this.club = club
    this.age = age
    this.strongHand = strongHand
    this.country = country
    this.gameVideo = gameVideo
  }
}
export default Opponent ;
